#
# Structure for table "sys_task"
#

CREATE TABLE `sys_task` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `cycle` varchar(30) NOT NULL,
  `url` mediumtext NOT NULL,
  `ip` varchar(20) DEFAULT NULL,
  `get_parm` mediumtext,
  `post_parm` mediumtext,
  `memo` mediumtext,
  `create_at` int(10) NOT NULL,
  `update_at` int(10) NOT NULL,
  `create_uid` int(10) NOT NULL,
  `update_uid` int(10) NOT NULL,
  `last_execute_time` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定时任务';

#
# Data for table "sys_task"
#


#
# Structure for table "sys_task_time"
#

CREATE TABLE `sys_task_time` (
  `id` int(10) NOT NULL,
  `time` int(10) NOT NULL,
  `result` mediumtext NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定时任务-执行日志';

#
# Data for table "sys_task_time"
#


#
# Structure for table "sys_user"
#

CREATE TABLE `sys_user` (
  `uid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(20) NOT NULL DEFAULT '' COMMENT '账号',
  `nickname` varchar(20) NOT NULL DEFAULT '' COMMENT '姓名',
  `gid` int(11) unsigned DEFAULT '0' COMMENT '用户组',
  `lid` int(11) DEFAULT '0' COMMENT '用户层级',
  `p1` int(11) DEFAULT '0' COMMENT '上级代理',
  `p2` int(11) unsigned DEFAULT '0' COMMENT '总代理',
  `rid` varchar(512) DEFAULT '' COMMENT '关系映射',
  `mobile` varchar(11) DEFAULT '' COMMENT '手机号码',
  `weixin` varchar(20) DEFAULT '' COMMENT '微信号码',
  `qq` varchar(15) DEFAULT '' COMMENT 'qq号码',
  `email` varchar(50) DEFAULT '' COMMENT '邮箱',
  `password` varchar(50) NOT NULL DEFAULT '' COMMENT '密码',
  `encrypt` varchar(7) NOT NULL DEFAULT '' COMMENT '密钥',
  `password_admin` varchar(20) DEFAULT '' COMMENT '二级密码',
  `is_activated` tinyint(1) DEFAULT '0' COMMENT '是否激活',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态：0 未审核，1正常，2 不通过，3 冻结 ， 4 停用',
  `last_ip` varchar(40) NOT NULL DEFAULT '' COMMENT '最后活动IP',
  `last_login` int(10) DEFAULT '0' COMMENT '最后登录时间',
  `login_ip` varchar(40) NOT NULL DEFAULT '' COMMENT '登录IP',
  `create_at` int(10) DEFAULT '0' COMMENT '注册时间',
  `update_at` int(10) DEFAULT '0' COMMENT '更新时间',
  `site` varchar(30) DEFAULT '' COMMENT '注册站点',
  `login_times` int(11) DEFAULT '0' COMMENT '登录次数',
  `refer` varchar(100) DEFAULT '' COMMENT '注册来路',
  `balance` decimal(20,2) DEFAULT '0.00' COMMENT '可用额度',
  `gift` int(11) DEFAULT '0' COMMENT '礼金',
  `pincode` varchar(100) DEFAULT '' COMMENT 'PIN密码',
  `ads_domain` varchar(50) DEFAULT '' COMMENT '推广域名',
  `is_del` varchar(255) NOT NULL DEFAULT '0' COMMENT '是否被逻辑删除',
  `white_ip` varchar(255) DEFAULT '' COMMENT '允许登录ip',
  `pass_question` varchar(50) DEFAULT NULL COMMENT '密保问题',
  `pass_answer` varchar(50) DEFAULT NULL COMMENT '密保答案',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=65 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户表';

