#
# Structure for table "sys_user_balance_log"
#

CREATE TABLE `sys_user_balance_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recdate` date NOT NULL DEFAULT '2018-01-01',
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `order_sn` char(32) NOT NULL DEFAULT '' COMMENT '订单号',
  `order_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '订单类型，1购彩 2撤单 3派彩 4返水,5充值 6人工入款 7优惠派送 8提款 9提款失败 10佣金提成 11额度转出 12额度转入 13 14人工惩罚扣款 15彩金清零 16充值返利 17手续费',
  `order_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `balance` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '可用余额',
  `channel` varchar(64) DEFAULT NULL COMMENT '渠道',
  `change_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '变动类型，0：扣款，1：余额增加',
  `rt` int(11) NOT NULL DEFAULT '0' COMMENT '写入时间',
  `ut` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `recdate_uid_type_idx` (`recdate`,`uid`,`order_type`),
  KEY `rec_type_idx` (`recdate`,`order_type`)
) ENGINE=InnoDB AUTO_INCREMENT=1159 DEFAULT CHARSET=utf8;

