#
# Structure for table "sys_user_log"
#

CREATE TABLE `sys_user_log` (
  `uid` int(11) DEFAULT '0',
  `site` varchar(255) DEFAULT NULL COMMENT '登录的来源',
  `ip` varchar(60) DEFAULT NULL COMMENT '登录的ip地址',
  `ip_msg` varchar(255) DEFAULT NULL COMMENT 'ip信息',
  `log_type` tinyint(1) DEFAULT '0' COMMENT '登录类型 1登录',
  `msg` varchar(255) DEFAULT NULL COMMENT '操作说明',
  `time` int(11) DEFAULT NULL COMMENT '操作时间',
  KEY `uid` (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户操作日志';

